import { Avatar, Col, Image, List, Row, Space, Typography } from 'antd';
import React from 'react';
import { API_KEY } from '../../constants/api-keys';

function CurrentlyPlayingList({ current }) {
	const { Title, Text } = Typography;
	const imgUrl = API_KEY.IMAGE_URL;
	console.log(current);

	const renderItem = (item) => {
		return (
			<List.Item>
				<Row gutter={[16, 16]}>
					<Col span={6}>
						<Avatar src={`${imgUrl + item.poster_path}`} />
					</Col>

					<Col span={6} />
					<Space>
						<Title level={3}>{item.title}</Title>
						<Text>{item.release_date}</Text>
					</Space>
					<Col span={6} />
				</Row>
			</List.Item>
		);
	};

	return (
		<List
			itemLayout='horizontal'
			size='large'
			dataSource={current}
			renderItem={renderItem}
		/>
	);
}

export default CurrentlyPlayingList;
